(1233,'2017-12-09 17:12:06',104,112,'Since all the team members were at the last minute of the semester, it seems like they have a lot of works to do.\r\nIn that, some people were not focusing on the assignments and did not try to revise after having the feedback, even though I asked on a group chat.\r\nAlso, one of the group member did not try to understand the requirement, asking all the time about what should he/she write about, what she should do.\r\nI was happy that I could help and I got to learn more about the tasks, but I was getting stressed that I also had a lot of works to do and it is time consuming to tell everything.\r\nIt looked like I was the only one who worries of the assignments.  \r\nOverall, however, team members tried to finish on deadline, we did what we have to do, and some suggested ideas.\r\n\r\nThis semester, I specially learned that the team members should be really diverse, and better to be team members with who I do not know. Because when you all know each others, it is easy to rely on them without responsibility. Also, if people know the character of each other, it is easy to pick one and rely on that person. ',20,'2017-12-09 17:21:07','2021-10-05 15:18:46','Since all the team members were at the last minute of the semester, it seems like they have a lot of works to do.\r\nIn that, some people were not focusing on the assignments and did not try to revise after having the feedback, even though I asked on a group chat.\r\nAlso, one of the group member did not try to understand the requirement, asking all the time about what should he/she write about, what she should do.\r\nI was happy that I could help and I got to learn more about the tasks, but I was getting stressed that I also had a lot of works to do and it is time consuming to tell everything.\r\nIt looked like I was the only one who worries of the assignments.  \r\nOverall, however, team members tried to finish on deadline, we did what we have to do, and some suggested ideas.\r\n\r\nThis semester, I specially learned that the team members should be really diverse, and better to be team members with who I do not know. Because when you all know each others, it is easy to rely on them without responsibility. Also, if people know the character of each other, it is easy to pick one and rely on that person. '),
