(1235,'2017-12-09 13:31:31',105,143,'Our group finally finished the data modelling assignment and worked on the security analysis after the presentation last Thursday. After the submission, Professor Micah sent us his feedback for our security analysis. So we will be meeting again to work on the assignment based on his feedback and to wrap up our semester. Since everyone has worked hard for every group assignment and collaborated well with each other, I have really enjoyed working with all of my group members for this semester!',25,'2017-12-10 06:39:37','2018-04-25 06:57:25','Our group finally finished the data modelling assignment and worked on the security analysis after the presentation last Thursday. After the submission, Professor Thomas sent us his feedback for our security analysis. So we will be meeting again to work on the assignment based on his feedback and to wrap up our semester. Since everyone has worked hard for every group assignment and collaborated well with each other, I have really enjoyed working with all of my group members for this semester!'),
