(2389,'2019-06-17 00:43:08',219,148,'I have to admit, in the beginning I was very enthusiastic about getting the work done with my group, but when I realized that I was the only one and everyone procrastinating, I lost the focus to get the job done on time and be the leader of the group because nobody was willing to do so. As the end of the semester came, we started to recollect ourselves and got back to work. The workload was based on our strengths. I organized our meetings and gave each member a particular workload and was in charge of decision makings in terms of the direction we wanted to go to. And because I was a student writing tutor, I went over the entire group paper to fix structure, organization, grammar and other issues that Professor wanted us to fix. Geunuk Na was very active in collecting data. While I was designing the spreadsheets and searching for datas, Geunuk gave me a lot of data and article that could supplement the design of the overall graphs and charts. Geunuk also helped Kyungeun with our railroad programs. Tommy tried to contribute, but it was not much compared to the others. However, I do not blame him because he constantly offered his help. It was only that he needed more time to understand  our group work, and because we procrastinated, we did not have much time. I might be biased, but I truly believe that Geunuk and I had much of a workload overall. ',74,'2019-06-17 00:56:48','2021-01-19 18:44:08','I have to admit, in the beginning I was very enthusiastic about getting the work done with my group, but when I realized that I was the only one and everyone procrastinating, I lost the focus to get the job done on time and be the leader of the group because nobody was willing to do so. As the end of the semester came, we started to recollect ourselves and got back to work. The workload was based on our strengths. I organized our meetings and gave each member a particular workload and was in charge of decision makings in terms of the direction we wanted to go to. And because I was a student writing tutor, I went over the entire group paper to fix structure, organization, grammar and other issues that Professor wanted us to fix. Jesse Mills was very active in collecting data. While I was designing the spreadsheets and searching for datas, Jesse gave me a lot of data and article that could supplement the design of the overall graphs and charts. Jesse also helped Stephen with our railroad programs. Kathy tried to contribute, but it was not much compared to the others. However, I do not blame him because he constantly offered his help. It was only that he needed more time to understand  our group work, and because we procrastinated, we did not have much time. I might be biased, but I truly believe that Jesse and I had much of a workload overall. '),
